import React from 'react';
import { VscLoading } from "react-icons/vsc";

const Loading = () => {

    const loadStyle = {
        width: "10%",
        margin: "auto",
    }

    const iconStyle = {
        fontSize: "5rem",
    }

    return (
        <div style={loadStyle}>
            <VscLoading style={iconStyle} />
        </div>
    )
}

export default Loading
